    return (
        <div className='project'>
            <h3><Skeleton /></h3>

            <p className='project__description'><Skeleton /></p>
            {(
                <ul className='project__stack'>
                    <li key='1' className='project__stack-item'><Skeleton /></li>
                    <li key='2' className='project__stack-item'><Skeleton /></li>
                </ul>
            )}

            {(
                <div
                    aria-label='source code'
                    className='link link--icon'
                >
                    <Skeleton />
                </div>
            )}

            {(
                <div
                    aria-label='source code'
                    className='link link--icon'
                >
                    <Skeleton />
                </div>
            )}
        </div>)
}

